        super(props);

        this.state = {
        };
    }

    render(){
        return(<Box
            justify = "center"
            margin = {{ "right" : "0"}}
            width = "70%"
            height = "10%"
            border={{
                "color": "border",
                "size": "medium",
                "style": "dashed",
                "side": "all"
              }}
        >
            <Paragraph>Hi I am top action bar component</Paragraph>
        </Box>)
    }
}

